import { React, useState, useEffect } from "react";
import GraphUI from './GraphUI.js';
import axios from 'axios';

const Graph = (geoCode) => {
    const [healthWard, setHealthWard] = useState(null);

    const url = 'http://covidradarmadrid-env.eba-wbgad2ub.eu-south-1.elasticbeanstalk.com/api/geocode/';

    useEffect( () => {
        async function getHealthWard() {
            console.log(url.concat(geoCode.geoCode))
            await axios.get(url.concat(geoCode.geoCode))
                .then( response => {
                    console.log(response.data);
                    setHealthWard(response.data);
                })
                .catch( error => console.error(`Error: ${error}`))
        }
        getHealthWard();
    }, []);

    var dailyRecords = healthWard.dailyRecords;
    var labels = dailyRecords.map(dailyRecord => toString(dailyRecord.date));
    var figures = dailyRecords.map(dailyRecord => dailyRecord.twoWeekCases);

    const toString = (date) => {
        const day = date[1];
        const month = date[2];
        const year = date[0];
        return day + "/" + month + "/" + year;
    }

    return (
        <GraphUI labels={labels} figures={figures} />
    );
}

export default Graph
